import React from 'react';
import Tabs from "../tab-forms/tab";
import styled from "styled-components";
import OnDemand from "./select-vehicle";
import Rental from "./select-vehicle";
import OurStation from "./select-vehicle";
import Delivery from "./select-vehicle";

const ContainerWrapper = styled("div")`
position:absolute;
top:0px;
margin: 20px;
`;

const ChildrenContainer = styled("div")`
border-top: 5px solid #EFF2F5;
padding:5px 0px;
`;


const Container = () => {
    return (
        <ContainerWrapper>
            <Tabs contentView={<ChildrenContainer><Rental/></ChildrenContainer>}/>
        </ContainerWrapper>
    );
}

export default Container;
